import React, { Component } from "react";

export default class ImageZoom extends Component {
  render() {
    const { image } = this.props;

    return (
      <img
        alt="zoom"
        src={`${image}`}
        className="img-fluid image_zoom_cls-0 ma-lr"
      />
    );
  }
}
